import React from "react";
import { BrowserRouter as Router, Switch, Route, BrowserRouter } from "react-router-dom";
import Home from "./core/Home";

const Routes = () =>{
    <BrowserRouter>
        <Switch>
            <Route path = "/" exact component = {Home} />
        </Switch>
    </BrowserRouter>
}

export default Routes;
